import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  const listItems = props.expenses;

  listItems.forEach((item) => {
      return (
        <div className="expenses">
          <ExpenseItem
            title={item.title}
            amount={item.amount}
            date={item.date}
          ></ExpenseItem>
        </div>
      );
  })
}

export default Expenses;
